import type {
  ICategoryType,
  ICategoryTypeListResponse,
  ICategoryTypeQueryParams,
  ICreateCategoryTypeParams,
  IUpdateCategoryTypeParams,
} from "@/types/api/category-type";

import type { IResponse } from "@/types/api/common";
import request from "@/utils/request";

// 获取分类类型列表
export const getCategoryTypes = async (
  params: ICategoryTypeQueryParams
): Promise<IResponse<ICategoryTypeListResponse>> => {
  return request.get("/category-types", { params });
};

// 获取单个分类类型
export const getCategoryType = async (
  id: number
): Promise<IResponse<ICategoryType>> => {
  return request.get(`/category-types/${id}`);
};

// 创建分类类型
export const createCategoryType = async (
  data: ICreateCategoryTypeParams
): Promise<IResponse<ICategoryType>> => {
  return request.post("/category-types", data);
};

// 更新分类类型
export const updateCategoryType = async (
  id: number,
  data: IUpdateCategoryTypeParams
): Promise<IResponse<ICategoryType>> => {
  return request.put(`/category-types/${id}`, data);
};

// 删除分类类型
export const deleteCategoryType = async (
  id: number
): Promise<IResponse<null>> => {
  return request.delete(`/category-types/${id}`);
};

// 切换分类类型状态
export const toggleCategoryTypeStatus = async (
  id: number
): Promise<IResponse<ICategoryType>> => {
  return request.patch(`/category-types/${id}/toggle-status`);
};
